// Home.tsx
import React from "react";
import { useNavigate } from "react-router-dom"; // Ensure this is correctly imported
import "./styles.css"; // Assuming this is the correct path to your CSS file

function Home() {
  const navigate = useNavigate(); // Hook to programmatically navigate

  // Handler to navigate to the login page
  const handleLoginNavigate = () => {
    navigate("/login"); // Adjust the path as per your routing setup
  };

  return (
    <div className="home-container">
      <div className="content">
        <h1>Welcome to BMW Cars</h1>
        <button className="login-button" onClick={handleLoginNavigate}>
          Login
        </button>
      </div>
    </div>
  );
}

export default Home;
